export default function Contact(props){
    let contact=props.content;
    return (
        <div className="" id="contact">
            <img src="https://booksforbadal.com/wp-content/uploads/2022/03/Contact-Us-banner_1586952394.jpg"></img>
            {
                contact.map((el)=>(
                    <p>{el.label}</p>
                ))
            }
        </div>
    )
}
